import classes from './HomeItems.module.css';


const HomeItems = props =>{

    return (
   
        <div className={classes.container}>
        <div className={classes.item} id="item1">item 1</div>
        <div className={`${classes.item} ${classes.item1}`} >item 2</div>
        <div className={classes.item} id="item3">item 3</div>
        </div>
        
    );



}

export default HomeItems;
